import React, { useState, useCallback } from 'react'
import { TouchableOpacity } from 'react-native';
import { View, Image, ImageBackground, Text, ScrollView } from 'react-native'
import { SafeAreaProvider, SafeAreaView } from 'react-native-safe-area-context';
import styles from '../App.styles';
import { TextInput } from 'react-native';
import { useFonts } from 'expo-font';
import { Ionicons, FontAwesome, FontAwesome5, Entypo, EvilIcons, Feather, MaterialCommunityIcons, MaterialIcons, AntDesign } from "react-native-vector-icons"

function Register({ navigation }) {

    const [showPassword, setShowPassword] = useState(true);

    const [fontsLoaded] = useFonts({
        'Kaushan': require('../assets/fonts/KaushanScript-Regular.ttf'),
        "Allura": require('../assets/fonts/Allura-Regular.ttf'),
        "Montserrat-Black": require('../assets/fonts/Montserrat-Black.ttf'),
        "Montserrat-BlackItalic": require('../assets/fonts/Montserrat-BlackItalic.ttf'),
        "Montserrat-Bold": require('../assets/fonts/Montserrat-Bold.ttf'),
        "Montserrat-BoldItalic": require('../assets/fonts/Montserrat-BoldItalic.ttf'),
        "Montserrat-Italic": require('../assets/fonts/Montserrat-Italic.ttf'),
        "Montserrat-Light": require('../assets/fonts/Montserrat-Light.ttf'),
        "Montserrat-LightItalic": require('../assets/fonts/Montserrat-LightItalic.ttf'),
        "Montserrat-Medium": require('../assets/fonts/Montserrat-Medium.ttf'),
        "Montserrat-MediumItalic": require('../assets/fonts/Montserrat-MediumItalic.ttf'),
        "Montserrat-Regular": require('../assets/fonts/Montserrat-Regular.ttf'),
        "Montserrat-Thin": require('../assets/fonts/Montserrat-Thin.ttf'),
        "Montserrat-SemiBold": require('../assets/fonts/Montserrat-SemiBold.ttf'),
        "Montserrat-SemiBoldItalic": require('../assets/fonts/Montserrat-SemiBoldItalic.ttf'),
        "Montserrat-ThinItalic": require('../assets/fonts/Montserrat-ThinItalic.ttf'),
    });

    const onLayoutRootView = useCallback(async () => {
        if (fontsLoaded) {
            await SplashScreen.hideAsync();
        }
    }, [fontsLoaded]);

    if (!fontsLoaded) {
        return null;
    }

    return (

        <SafeAreaView style={styles.SafeAreaView}>

            <View style={styles.RegisterTopbar}>

                <View style={{ position: "absolute", width: "100%", height: "100%", alignItems: "flex-start", justifyContent: "center", left: "10%" }}>
                    <TouchableOpacity onPress={() => { navigation.goBack() }}>
                        <FontAwesome5 style={{ fontSize: 18, color: "white" }} name="chevron-left" />
                    </TouchableOpacity>
                </View>

                <View>
                    <Text style={{ fontSize: 16, color: "#f7ede4", fontFamily: "Montserrat-SemiBold" }}>Kayıt Ol</Text>
                </View>

            </View>

            <View style={{ width: "100%", padding: 10, alignItems: "center", flex: 1, }}>

                <ScrollView style={{ flex: 1, width: "100%", padding: 10 }} contentContainerStyle={{ alignItems: "center" }} showsVerticalScrollIndicator={false}>

                    <View style={styles.RegisterSingleBox}>
                        <TextInput id='register_name' placeholder='İsim' placeholderTextColor={"grey"} style={styles.RegisterSingleBoxInput} ></TextInput>
                    </View>
                    <View style={styles.RegisterSingleBox}>
                        <TextInput id='register_surname' placeholder='Soyisim' placeholderTextColor={"grey"} style={styles.RegisterSingleBoxInput} ></TextInput>
                    </View>
                   {/*  <View style={styles.RegisterSingleBox}>
                        <TextInput id='register_burc' placeholder='Burcunuz' placeholderTextColor={"grey"} style={styles.RegisterSingleBoxInput} ></TextInput>
                    </View> */}
                    <View style={styles.RegisterSingleBox}>
                        <TextInput id='register_mail' placeholder='E-mail' placeholderTextColor={"grey"} style={styles.RegisterSingleBoxInput} ></TextInput>
                    </View>
                    <View style={styles.RegisterSingleBox}>
                        <TextInput id='register_password' placeholder='Şifre' placeholderTextColor={"grey"} style={styles.RegisterSingleBoxInput} ></TextInput>
                    </View>

                    <View style={styles.RegisterSingleBox}>
                        <TextInput id='register_password_again' placeholder='Şifre Tekrar' placeholderTextColor={"grey"} style={styles.RegisterSingleBoxInput} ></TextInput>
                    </View>

                </ScrollView>

                <View style={{ width: "100%", height: 50, alignItems: "center", justifyContent: "center" }}>

                    <TouchableOpacity onPress={() => { navigation.navigate("Login") }} style={{ width: "40%", height: 35, alignItems: "center", justifyContent: "center", borderRadius: 100, backgroundColor: "#bf7837", }}>
                        <Text style={{ fontSize: 12, color: "#f7ede4", fontFamily: "Montserrat-SemiBoldItalic" }}>Kayıt Ol</Text>
                    </TouchableOpacity>
                </View>




            </View>




        </SafeAreaView>
    )
}
export default Register;
